import React from 'react';


const divStyle = {
    width: '85px',
    heigth: '85px',
    margin: '10px'
};
class Box extends React.Component {



    render() {
        return (
            <button
                className="square"
                onClick={() => this.props.onClick()}

            >
                {this.props.value}
            </button>
        );
    }
}

export default Box;
